    false,nt"url": null,nt"notes": "Black Ducks (Anas rubripes) are an important
    game species in the northeastern United States but their numbers have declined greatly
    in the last three decades. Hunting pressure, hybridization with Mallards (Anas platyrhynchos),
    severe weather in the 1950's and habitat loss may all have played a role in  causing
    the decline of Black Ducks. Wintering populations are highest in states with large
    amounts of salt marsh, such as Massachusetts, New Jersey and North Carolina. Of
    particular interest now is the role of salt marshes in providing food for migrating
    or wintering black ducks in the North Atlantic Coast  region, and the possibility
    of using mosquito control practices to enhance habitat suitability for Black Ducks.
    This will be the focus of our research efforts in Parker River National Wildlife
    Refuge. We propose a study of habitat use and numbers of Black Ducks on Parker River
    Refuge and of their response to Open Marsh Water Management. We will develop and
    test census techniques  which will allow us to determine which habitats are most
    used by Black Ducks and whether there are any seasonal shifts. Based on earlier
    studies of habitat use by ducks and the effects of ditching and Open Marsh Water
    Management, we will test various modifications of OMWM designed to enhance waterfowl
    habitat.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
